import React from 'react';
import './styles.css';
import NavRoot from '../../ModuleComponents/Nav/NavRoot/';


function Sales(){
  return(
    <div >
      <NavRoot/>
    <div className="container">
      <div className="RootSalesStyle">
      <h1 className="SalesMessage">Estas son las ventas</h1>
      </div>
    </div>
    <br/>
    <br/>
    <br/>
    </div>
  );
}

export default Sales;
